'use client'
import React, { useState, useEffect } from 'react';
import Link from 'next/link';
import './App.css';


function App() {
  const [currentSlide, setCurrentSlide] = useState(0);
  const [dummyLoginClicked, setDummyLoginClicked] = useState(false); 
  const [showAdditionalLink, setShowAdditionalLink] = useState(false);

  // Dummy data for the slideshow
  const slides = [
    'https://via.placeholder.com/400x200?text=Slide%201',
    'https://via.placeholder.com/400x200?text=Slide%202',
    'https://via.placeholder.com/400x200?text=Slide%203',
    'https://via.placeholder.com/400x200?text=Slide%204',
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
    }, 10000);

    return () => clearInterval(interval);
  }, [slides.length]);

  const handlePrevSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide === 0 ? slides.length - 1 : prevSlide - 1));
  };

  const handleNextSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
  };

  const handleDummyLogin = () => {
    setShowAdditionalLink(true);
    setDummyLoginClicked(true);
  }

  const handleLogout = () => {
    setDummyLoginClicked(false);
    setShowAdditionalLink(false);
  }

  const cards = [
    { title: 'Card 1', description: 'Description of Card 1', imageUrl: 'data:image/jpeg;base64,',width: 100, 
    height: 200 },
    { title: 'Card 2', description: 'Description of Card 2', imageUrl: 'data:image/jpeg;base64,' },
    { title: 'Card 3', description: 'Description of Card 3', imageUrl: 'data:image/jpeg;base64,' },
    { title: 'Card 4', description: 'Description of Card 4', imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSvsx3oh-U5UuHrsYJzxvJa4ooMbIDP8in_jQ&s' },
  ];

  return (
    <div className="App">
      <header className="header">
        <div className="logo">
          <img src="/images/ARTCHIVE.png" alt="Our Logo" />
        </div>
        <div className="search-bar">
          <input type="text" placeholder="artist/category" />
          <button type="submit">Search</button>
        </div>
        <div className="centered-element">
          <h1>THE ARTCHIVE</h1>
        </div>
        {!dummyLoginClicked && (
          <button className="link" onClick={handleDummyLogin}>DUMMY LOG IN</button>
        )}
        {showAdditionalLink && (
          <>
            <Link href="/portfolio" className="link">My Portfolio</Link>
            <button className="link" onClick={handleLogout}>LOG OUT</button>
          </>
        )}
        {!dummyLoginClicked && <Link href="/login" className="link">LOG IN</Link>}
      </header>

      {/* Slideshow */}
      <div className="slideshow">
        <button className="slide-btn prev-btn" onClick={handlePrevSlide}>{'<'}</button>
        <img src={slides[currentSlide]} alt={`Slide ${currentSlide + 1}`} className="slide-img" />
        <button className="slide-btn next-btn" onClick={handleNextSlide}>{'>'}</button>
      </div>

      {/* Slide indicators */}
      <div className="slide-indicators">
        {slides.map((slide, index) => (
          <div key={index} className={`indicator ${index === currentSlide ? 'active' : ''}`} />
        ))}
      </div>

      {/* Discover section */}
      <div className="discover-container">
        <div className="oval"></div>
        <h2>DISCOVER</h2>
      </div>

      {/* Four cards */}
      <div className="cards">
        {cards.map((card, index) => (
          <div key={index} className="card">
            <h3>{card.title}</h3>
            <img src={card.imageUrl} alt={card.title} />
            <p>{card.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;